import React from "react";
import Card from "./Card";

const CardList = (props) => {
  const cardArray = props.robot.map((robot, i) => {
    return (
      <Card
        id={props.robot[i].id}
        name={props.robot[i].name}
        email={props.robot[i].email}
      />
    );
  });
  return <div>{cardArray}</div>;
};

export default CardList;
